import React from 'react';
import farmsimple from "../../images/icon-fs-orange.svg";
import './header.css';
import{ Segment } from 'semantic-ui-react';
export default function Header() {
  return(
      
   <header data-booted="true">
   
  
        <div class="v-toolbar__content" style={{"height": "64px"}}>
           
      <img src={farmsimple} height="50px" class="mr-5"></img>
      <div class="v-toolbar__title" style={{"color": "rgb(79, 79, 79)"}}><b >FARM</b>SIMPLE Console</div>
      <div class="spacer"></div>
      
      <span id="userDetails">Align Agith </span> | 
      <span id="userDetails" style={{"color": "rgb(244, 67, 54)"}}> Owner</span>
      <button type="button" class="white--text v-btn v-btn--is-elevated v-btn--has-bg theme--light v-size--default deep-orange darken-2"><span class="v-btn__content">Logout </span>
      </button>
      </div>
     
    </header>
      
      );
}
